import React from "react";
import Entry from "./components/Entry";
import InputForm from "./components/InputForm";
import ModalWindow from "./components/ModalWindow";

function App() {
  let entries = [];
  function passData(name, age) {
    // console.log("back in app.js");
    // console.log(name);
    // console.log(age);
    entries.push({
      name: name,
      age: age,
    });
    console.log(entries);
  }
  return (
    <div>
      <Entry onDataSubmit={passData}></Entry>
      <InputForm sendEntries={entries}></InputForm>
    </div>
  );
}

export default App;
